  false,\n\t\"url\": null,\n\t\"notes\": \"This document contains plans, maps, data
  tables, and journal articles related to forest management and timber sales on Clarence
  Cannon NWR and the surrounding area. The following documents are included: an excerpt
  from the \"Bottomland Reforestation Plan : Division II\"; a table titled \"Compartment
  07p21 report\" which includes a list of Missouri timber buyers; a list of forestry
  contractors; and articles from the Society of American Foresters which describe
  river birch, sycamore, silver maple, American elm, cottonwood, pin oak, sweetgum,
  and black willow trees.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
